import logo from './logo.svg';
import './App.css';
import Header from './components/header';
import Body from './components/body';
import Footer from './components/footer';

function App() {
  return (
    <div className="App">
      <center>
        <div class="h1-text">
          <h2>Welcome to learnz app</h2>
          <Header></Header>
          <Body></Body>
          <Footer></Footer>
        </div>
      </center>
    </div>
  );
}

export default App;
